var map = new DefaultingMap<int, int>(new int[] { 10, 7, 5 });\n\nmap.Add(new int[] { 1, 2, 3 }, 5);\nmap.Add(new int[] { null, 2, 3 }, 4);\nmap.Add(new int[] { 1, null, null }, 2);\nmap.Add(new int[] { null, null, null }, 1);\n\nConsole.WriteLine(map.Get(new int[] { 1, 2, 3 })); // outputs 5\nConsole.WriteLine(map.Get(new int[] { 3, 2, 3 })); // outputs 4\nConsole.WriteLine(map.Get(new int[] { 8, 10, 11 })); // outputs 1\nConsole.WriteLine(map.Get(new int[] { 1, 10, 11 })); // outputs 2